var makeDom=require("../utils").makeDom,assert=require("assert");describe("helpers",function(){describe("removeSubsets",function(){var e=require("../..").removeSubsets,t=makeDom("<div><p><span></span></p><p></p></div>")[0];it("removes identical trees",function(){var n=e([t,t]);assert.equal(n.length,1)});it("Removes subsets found first",function(){var n=e([t,t.children[0].children[0]]);assert.equal(n.length,1)});it("Removes subsets found last",function(){var n=e([t.children[0],t]);assert.equal(n.length,1)});it("Does not remove unique trees",function(){var n=e([t.children[0],t.children[1]]);assert.equal(n.length,2)})})});